import React, { useEffect, useState } from 'react';

const Result = ({ user_cpu, user_gpu, user_ram, game_name, game_id }) => {
    const [results, setResults] = useState([])
    const fetchResults = async () =>{
      try{
        return await fetch(
          `http://localhost:3001//api/verify?id=${game_id}`);
      }catch(error){
        console.log(error);
      }finally{
        const dummy = [{
          'min_cpu': 'None',
          'min_gpu': 'None',
          'min_ram': 'None',
          'rec_cpu': 'None',
          'rec_gpu': 'None',
          'rec_ram': 'None'
      }]
        return dummy
      }
    };

    useEffect(()=> {
      setResults(fetchResults);
    },[results])

  return (
    <div>
      <div className='result'>
          'min_cpu': {results.min_cpu}
          <br/>
          'min_gpu': {results.min_gpu}
          <br/>
          'min_ram': {results.min_ram}
          <br/>
          'rec_cpu': {results.rec_cpu}
          <br/>
          'rec_gpu': {results.rec_gpu}
          <br/>
          'rec_ram': {results.rec_ram}
      </div>
    </div>
  );
};

export default Result;
